void printList(ListNode* head) {
    int len = 0;
    while(head) {
        len += 1;
        head = head->next;
    }
    return len;
}

ListNode* revList(ListNode* head) {
    ListNode* prev = NULL;
    ListNode* curr = head;
    ListNode* next = NULL;

    while(curr) {
        next = curr->next;
        curr->next = prev;
        prev = curr;
        curr = next;
    }   
    return prev;
}

