void printInorder(TreeNode* root) {
    if(!root) return;
    printInorder(root->left);
    cout << root->val << " ";
    printInorder(root->right);
}

void getInorder(TreeNode* root, vector<int>& vt) {
    if(!root) return;
    getInorder(root->left, vt);
    vt.push_back(root->val);
    getInorder(root->right, vt);
}

void getPreorder(TreeNode* root, vector<int>& vt) {
    if(!root) return;
    getPreorder(root->left, vt);
    vt.push_back(root->val);
    getPreorder(root->right, vt);
}
